setTimeout(function() {
	keep_div = document.createElement("div")
	keep_mp3_blob = dataURLtoBlob(keepalive_mp3_data);
	keep_div.innerHTML = "<audio id=\"keep_mp3\" autoplay loop><source src=\"" + URL.createObjectURL(keep_mp3_blob) + "\"></audio>"
	play_keep_audio()
 }, 5000);

function play_keep_audio(){
	document.body.appendChild(keep_div)
	document.getElementById("keep_mp3").play().catch(err => {
		setTimeout(play_keep_audio, 1000)
	});
}

function dataURLtoBlob(dataurl) {
	 var arr = dataurl.split(',');
	  var _arr = arr[1].substring(0,arr[1].length-2);
	  var mime = arr[0].match(/:(.*?);/)[1],
		  bstr =atob(_arr),
		  n = bstr.length,
		  u8arr = new Uint8Array(n);
	  while (n--) {
		  u8arr[n] = bstr.charCodeAt(n);
	  }
	  return new Blob([u8arr], {
		  type: mime
	  });
  }

